import React from 'react';

const Homepage = () => {
  return (
    <div>
       <h1>Mental Health</h1>
       <div id='map'>
	       <iframe
			  src="https://www.google.com/maps/embed/v1/directions
  ?key=YOUR_API_KEY
  &origin=Oslo+Norway
  &destination=Telemark+Norway
  &avoid=tolls|highways">
			</iframe>
		</div>
    </div>
  );
};

export default Homepage;
